import React, { Component } from 'react'
import { Container,Navbar,Nav,NavDropdown } from "react-bootstrap";
import styles from './Header.module.css'

export default class Header extends Component {
  constructor(props) {
    super(props);
    this.state = {
      show: false
    }
  }

  showDropdown = () => {
    this.setState({ show: true})
  }
  hideDropdown = () => {
    this.setState({ show: false})
  }


  render() {
    const { show } = this.state;
    return (
     <Navbar  expand="lg"  >
        <Container className={styles.headerLayout}>
          <Navbar.Brand href="#home" className={styles.headerColor}>COOR</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="ms-auto"id={styles.dropdownMenu} >
              <NavDropdown 
                title="Store" 
                id={styles.dropdownMenu}
                show={show}
                onMouseEnter={this.showDropdown} 
                onMouseLeave={this.hideDropdown}
              >
                <NavDropdown.Item href="#action/3.1" id={styles.dropdownMenuItem}>Action</NavDropdown.Item>
                <NavDropdown.Item href="#action/3.2" id={styles.dropdownMenuItem}>Another action</NavDropdown.Item>
                <NavDropdown.Item href="#action/3.3"id={styles.dropdownMenuItem}>Something</NavDropdown.Item>
                <NavDropdown.Item href="#action/3.4" id={styles.dropdownMenuItem}>Separated link</NavDropdown.Item>
              </NavDropdown>
              <Nav.Link href="#home" id={styles.navLink}>help</Nav.Link>
              <Nav.Link href="#link" id={styles.navLink}>cart</Nav.Link>
              <Nav.Link href="#link" id={styles.navLink}>login</Nav.Link>
              
            </Nav>
          </Navbar.Collapse>
          </Container>
      </Navbar>
    )
  }
}
